tables.table_schema:
CREATE TABLE musicians_merchandise (
    musician_id INT,
    merchandise_name VARCHAR(255),
    merchandise_category VARCHAR(50),
    merchandise_price DECIMAL(10, 2)
);

CREATE TABLE online_store_transactions (
    transaction_id INT,
    musician_id INT,
    transaction_date DATE,
    transaction_amount DECIMAL(10, 2),
    transaction_status VARCHAR(20)
);

CREATE TABLE Merchandise (
    merchandise_id UUID PRIMARY KEY,
    merchandise_name VARCHAR(255),
    merchandise_price DECIMAL(10,2),
    merchandise_description TEXT
);

CREATE TABLE Musicians (
    musician_id UUID PRIMARY KEY,
    musician_name VARCHAR(255),
    musician_genre VARCHAR(50),
    musician_birthdate DATE
);

CREATE TABLE musicians (
    musician_id INT PRIMARY KEY,
    name VARCHAR(255),
    genre VARCHAR(100),
    debut_year INT
);

CREATE TABLE merchandise (
    merchandise_id INT PRIMARY KEY,
    item_name VARCHAR(255),
    price DECIMAL,
    artist_id INT
);

CREATE TABLE transactions (
    transaction_id INT PRIMARY KEY,
    transaction_date DATE,
    total_amount DECIMAL,
    customer_id INT
);

CREATE TABLE customers (
    customer_id INT PRIMARY KEY,
    customer_name VARCHAR(255),
    email VARCHAR(255)
);

CREATE TABLE merchandise (
    item_id INT PRIMARY KEY,
    item_name VARCHAR(255),
    price DECIMAL(10,2),
    description TEXT
);
